import React from "react";

export default function Photos(props) {
    if (props.photos.length) {
        return (
            <section className="Photos">
                <div className="row">
                    {props.photos.map(function (photo, index) {
                        return (
                            <div className="col-9" key={index}>
                                <a href={photo.src.original} target="_blank" rel="noopener ronreferrer">

                                <img src={photo.src.landscape} className="img-fluid rounded" alt={photo.photographer}/>
                                </a>
                                </div>
                        );
                    })}
                </div>
            </section>
        );
                  }  else {
        return null;
      }
    }
